import { Text, View } from 'react-native'
import React, { Component } from 'react'

const Button = () => {
    return (
        <View style={styles.container}>
            <Text>Button</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#120E0B',
      alignItems: 'center',
      justifyContent: 'center',
    },
  });

export default Button;
